  false,\n\t\"url\": null,\n\t\"notes\": \"Digital orthographic imagery datasets contain
  georeferenced images of the Earth's surface, collected by a sensor in which object
  displacement has been removed for sensor distortions and orientation, and terrain
  relief. Digital orthoimages have the geometric characteristics of a map, and image
  qualities of a photograph. (Source: Circular A-16, p. 16) These files contain 2004
  digital orthoimagery of Sullivan County, New York. Image pixel size is 30 cm, natural
  color image. Image horizontal accuracy is +/-4 ft. at the 95% confidence level.
  Each file contains an image covering 750 meters by 750 meters on the ground. The
  second set of tiles are panchromatic. Image pixel size is 60 cm. Image horizontal
  accuracy is +/-8 ft at the 95% confidence level. Each file contains an image covering
  1500 meters by 1500 meters on the ground. Total tiles used 1431, in which 217 tiles
  are natural color and 30 cm GSD and 1214 tiles are panchromatic and 60 cm pixel
  size GSD. The following meta data contains compiled information on the 30 cm and
  60 cm images.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
